const reset = (ev) => {
    msg.textContent = '';
    let x = document.getElementById('result');

    x.style.display = 'none';

    
}

const checkNumbers = (ev) => {
    ev.preventDefault();
    let form = document.forms[0];
    let msg = document.getElementById('msg');
    let match = 0;
    let register = [];
    let text = '';
    let numbers = [];

    let x = document.getElementById('result');

    x.style.display = 'block';

    for(let i=0; i<15; i++) {

        if(form.elements[i].value < 10 && form.elements[i].value.length < 2) {
            form.elements[i].value = "0" + form.elements[i].value;
            if(form.elements[i].value == "0") {
                form.elements[i].value = "0" + form.elements[i].value;
            }
        }
        numbers.push(form.elements[i].value);
    }

    numbers = numbers.filter(function(item, pos, self) {
        return self.indexOf(item) == pos;
    })

    sorteios.forEach((element => {
        element.dezenas.forEach((number) => {

            for(let i=0; i<numbers.length; i++) {

                if(numbers[i] == number) {
                    match = match + 1;
                }
            }
        })
        if(match >= 4) {
            register.push({numeroConcurso: element.numero_concurso, acertos: match});
        }
        // console.log(register);
        match = 0;
    }))

    if(register.length > 0) {

        register.forEach((element, index) => {
            text += `Você teve ${register[index].acertos} acertos no sorteio ${register[index].numeroConcurso}<br>`;
        })

        msg.innerHTML = text;

    } else {
        msg.textContent = "Você não teve nenhum acerto!";
    }

}

document.getElementById('button-send').addEventListener('click', checkNumbers);

document.getElementById('button-reset').addEventListener('click', reset);


